import React from 'react';
import { Link } from 'react-router-dom'

class App extends React.Component {

  render() {
    return (
      <div className="App">
        <h1>Hello</h1>
        <Link to="/System">System</Link><br></br>
        <Link to="/Lecture">Lecture</Link>
      </div>
    )
  }
}

export default App;
